final List<dynamic> styles = ['.dialog-custom {\n  min-width: 360px;\n}\n\n.material-fab-add {\n  position: fixed !important;\n  z-index: 9999;\n  float: right;\n  bottom: 64px;\n  right: 64px;\n  background-color: #db4437;\n  color: #fff;\n}\n\n.input-container {\n  display: inline-block;\n  padding-top: 0px;\n  padding-bottom: 0px;\n  width: 100%;\n}\n.input-container:focus-within label {\n  display: block;\n  font-size: 12px;\n  color: #4285f4;\n  margin-top: -4px;\n}\n.input-container:not(:focus-within) label {\n  display: block;\n  font-size: 12px;\n  color: rgba(0, 0, 0, 0.54);\n  margin-top: -4px;\n}\n.input-container material-datepicker {\n  display: block;\n  margin-top: 4px;\n}\n.input-container material-dropdown-select {\n  display: block;\n  margin-top: 4px;\n  margin-bottom: 24px;\n}\n\n/*\n// based on AngularDart Gallery - MaterialInput\n// basead on  @include button-color(\$not-raised, \$color) MaterialButton Mixins - THIS DID NOT WORK FINE\n\n  \$color: \$mat-blue;\n  \$selector: \'material-button\';\n  \$raised: \$selector + \'[raised]\';\n  @include button-background-color(\$raised, \$color);\n  @include button-color(\$raised, \$mat-white);\n\n  \$not-raised: \$selector + \':not([raised])\';\n  @include button-color(\$not-raised, \$color);\n*/\n::ng-deep material-button:not([disabled]):not([icon])[raised] {\n  background-color: #4285f4;\n  color: #fff;\n}\n::ng-deep material-button:not([disabled]):not([icon]):not([raised]) {\n  color: #4285f4;\n}\n\n.footer-material-tab {\n  margin-left: -16px;\n  margin-right: -16px;\n  box-sizing: border-box;\n  flex-shrink: 0;\n  padding: 16px 8px 16px 8px;\n  border-top: 1px #e0e0e0 solid;\n}\n\n/*\n.width-200 {\n   width: 200px;\n   white-space: pre-wrap;\n}\n*/\n/*\nmaterial-input {\n  padding: 4px;\n}\n*/\nmaterial-dropdown-select {\n  width: 250px;\n  min-width: 250px;\n}\n\n.material-shadow-box-list {\n  overflow: hidden;\n  padding: 16px;\n  margin: 16px;\n  line-height: 1;\n}\n.material-shadow-box-list[animated] {\n  transition: box-shadow 0.28s cubic-bezier(0.4, 0, 0.2, 1);\n}\n.material-shadow-box-list[elevation="1"] {\n  /*! @noflip */\n  box-shadow: 0 2px 2px 0 rgba(0, 0, 0, 0.14), 0 3px 1px -2px rgba(0, 0, 0, 0.12), 0 1px 5px 0 rgba(0, 0, 0, 0.2);\n}\n.material-shadow-box-list[elevation="2"] {\n  /*! @noflip */\n  box-shadow: 0 4px 5px 0 rgba(0, 0, 0, 0.14), 0 1px 10px 0 rgba(0, 0, 0, 0.12), 0 2px 4px -1px rgba(0, 0, 0, 0.2);\n}\n.material-shadow-box-list[elevation="3"] {\n  /*! @noflip */\n  box-shadow: 0 6px 10px 0 rgba(0, 0, 0, 0.14), 0 1px 18px 0 rgba(0, 0, 0, 0.12), 0 3px 5px -1px rgba(0, 0, 0, 0.2);\n}\n.material-shadow-box-list[elevation="4"] {\n  /*! @noflip */\n  box-shadow: 0 8px 10px 1px rgba(0, 0, 0, 0.14), 0 3px 14px 2px rgba(0, 0, 0, 0.12), 0 5px 5px -3px rgba(0, 0, 0, 0.2);\n}\n.material-shadow-box-list[elevation="5"] {\n  /*! @noflip */\n  box-shadow: 0 16px 24px 2px rgba(0, 0, 0, 0.14), 0 6px 30px 5px rgba(0, 0, 0, 0.12), 0 8px 10px -5px rgba(0, 0, 0, 0.2);\n}\n.material-shadow-box-list[elevation="6"] {\n  /*! @noflip */\n  box-shadow: 0 24px 38px 3px rgba(0, 0, 0, 0.14), 0 9px 46px 8px rgba(0, 0, 0, 0.12), 0 11px 15px -7px rgba(0, 0, 0, 0.2);\n}\n\n/*\n.material-list-item {\n    padding: -16px;\n    margin: -16px;\n}\n*/\n.material-input-disabled-color-custom-true ::ng-deep .disabled-underline {\n  border-color: #4285f4;\n}\n.material-input-disabled-color-custom-true ::ng-deep .top-section > .input-container > .label > .label-text {\n  color: #4285f4;\n}\n\ninput[type=file] {\n  display: none;\n}\n\n.text-decoration-none {\n  text-decoration: none;\n}\n\n.input-bottom-section-margin ::ng-deep .bottom-section {\n  margin: 0px;\n}\n\n.input-padding ::ng-deep material-input.themeable {\n  padding: 0px;\n}\n\n.buttom-delete-right ::ng-deep div:last-child {\n  margin-left: auto;\n}\n\n.no-padding-left-first ::ng-deep div:first-child {\n  margin-left: 0;\n  padding-left: 0;\n}\n\n/*\n.material-select-dropdown-padding {\n  @include material-select-dropdown-padding(0px);\n}\n\n.dropdown-icon-spacing {\n  @include dropdown-icon-spacing(0px);\n}\n*/\n.expansionpanel-no-border-false ::ng-deep div.panel.themeable {\n  border: 0;\n  box-shadow: none;\n}\n\n/*\n.no-content-margin {\n  @include expansionpanel-no-content-margin();\n}\n\n.flat-on-collapse-theme {\n  @include expansionpanel-flat-on-collapse-theme();\n}\n\n.expansionpanel-border-width {\n  @include expansionpanel-border-width(10px);\n}\n\n.expansionpanel-open-border-width {\n  @include expansionpanel-open-border-width(5px);\n}\n*/\n'];